import { GET_WEBS, ADD_WEBS } from '../actions/types';

const initialState = {
    items : []
}

export default function(state = initialState, action){
    switch(action.type){

        case GET_WEBS:
            return{
                ...state,
                items: action.payload
            }

        default:
            return state
    }
}
